    vector<string> folder = {"/a", "/a/b", "/c/d", "/c/d/e", "/c/f"};
    // {"/a", "/c/d", "/c/f"}
    print<string>(obj.removeSubfolders(folder), "\n", '"');

    folder = vector<string>{"/a", "/a/b/c", "/a/b/d"};
    // {"/a"}
    print<string>(obj.removeSubfolders(folder), "\n", '"');

    folder = vector<string>{"/a/b/c", "/a/b/ca", "/a/b/d"};
    // {"/a/b/c", "/a/b/ca", "/a/b/d"}
    print<string>(obj.removeSubfolders(folder), "\n", '"');

